pragma solidity ^0.8.0;

// Template payment token contract
contract PaymentToken {
    function transfer(
        uint256 balance,
        address payable receiver
    ) public returns (bool) {
        return true;
    }
}

// Template SGX verifier contract
contract SGXVerifier {
    function verify(
        string calldata attestation,
        string calldata MANEFEST
    ) public returns (bool) {
        return true;
    }
}

