    string constant VERIFIER =
        "'''
Verifies validity of encrypted code, keys, key_hash, and exploit code
'''
from hashlib import sha256
import rsa
from submission import exploit_entry
from interface import database_interface, database_init, verify_results
from cryptography.fernet import Fernet


def generate_commitments():
    '''
    Generate encrypted files and hashes for commitment
    Print encrypted key hash and hash of encrypted code
    '''
    # Import encryption keys
    with open('public_key.txt', 'r', encoding='utf-8') as fp:
        public_key = rsa.PublicKey.load_pkcs1(fp.read().encode('utf-8'))
    with open('submitter_key.bytes', 'rb') as fp:
        submitter_key = fp.read()
    fernet = Fernet(submitter_key)

    # Generate encrypted_key.txt
    with open('encrypted_key.bytes', 'wb+') as fp:
        public_encrypted_key = rsa.encrypt(
            submitter_key, public_key)
        fp.write(public_encrypted_key)

    # Generate key_hash.txt
    with open('key_hash.txt', 'w+', encoding='utf-8') as fp:
        fp.write(sha256(public_encrypted_key).hexdigest())
        print(sha256(public_encrypted_key).hexdigest())

    # Generate ecrypted_code.txt
    with open('submission.py', 'r', encoding='utf-8') as code_fp, \
            open('encrypted_code.bytes', 'wb') as encrypted_fp:
        code_str = code_fp.read().encode('utf-8')
        code_public_encrypted = b''.join([rsa.encrypt(
            code_str[i:i+245], public_key) for i in range(0, len(code_str), 245)])
        code_fernet_encrypted = fernet.encrypt(code_public_encrypted)
        encrypted_fp.write(code_fernet_encrypted)
        print(sha256(code_fernet_encrypted).hexdigest())


if __name__ == "__main__":
    # Generate commitments for submission
    generate_commitments()

    # Initialize database
    hashes = database_init()

    # Run exploit
    results = exploit_entry(database_interface)

    # Check submission hash
    print(verify_results(results))
";
    string constant INTERFACE =
        "'''
Defines interaction interface of database
'''
import random
from hashlib import sha256
import numpy as np
import faiss

rand_data = None
data_hashes = None
index = None

LENGTH = 1000  # Length of sequences
DATA_SIZE = 1000  # Number of datapoints generated
RESULT_SIZE = 100  # Max number of result sequences accepted
MAX_DISTANCE = LENGTH/100  # Maximum hamming distance variation allowed for results


def database_init():
    '''
    Generate random numpy arrays for dataset
    Returns a list of hashes
    '''
    global rand_data
    global data_hashes
    global index
    rand_data = np.random.randint(0, high=4, size=(DATA_SIZE, LENGTH))
    data_hashes = [sha256(x).hexdigest() for x in rand_data]

    # Create LSH neighbor search object
    index = faiss.IndexLSH(LENGTH,40)
    index.add(rand_data)

    return data_hashes


def database_interface(command):
    '''
    Simulate interaction interface, URL request, etc.
    '''
    if command == 'leak':
        return random.choice(rand_data)
    return ""


def verify_results(results_list):
    '''
    Check if any entry in results_list is close to a database entry
    Returns boolean as result
    '''
    assert len(
        results_list) <= RESULT_SIZE, f'Result size {RESULT_SIZE} exceeded'
    _, reference_matches = index.search(results_list, 1)
    for reference, exploit in zip(reference_matches, results_list):
        if np.sum(rand_data[reference] != exploit) <= MAX_DISTANCE:
            return True
    return False
