    string constant PUBKEY =
        "-----BEGIN RSA PUBLIC KEY-----
MIIBCgKCAQEAjBGkgQo/WFc+qlNOPlx4SSRVfEVL0HSzeVzploPuoHyQohjdLkNr
J8l9Jy3EoYpBU4mcCdeHm0rAS2CwB3BWY+7l5U3ttiBpmE9PfGsP59skug1bQscw
